import React, { Component } from 'react';

export default class CreateComponent extends Component {
  render() {
    return (
      <section className="custom-card-singin">
        <div className="container">
          <h1 className="d-flex justify-content-center pb-4 pt-4">Sing In</h1>
          {/* START Alert Fields are required */}
          {this.state.showAlertRequiredFields && (
            <div className="alert alert-danger" role="alert">
              Och noo something is wrong with yours required fields.
            </div>
          )}
          {/* END Alert Fields are required */}

          {/* START Alert password matching */}
          {this.state.showAlertPassword && (
            <div className="alert alert-danger" role="alert">
              Yours passwords aren't the same.
            </div>
          )}
          {/* END Alert password matching */}

          <div className="card">
            <div className="card-body">
              <form>
                {/* START First Name */}
                <div className="form-group pt-2">
                  <input
                    type="text"
                    name="firstName"
                    className="form-control"
                    aria-describedby="emailHelp"
                    placeholder="First Name"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END First Name */}

                {/* START Last Name */}
                <div className="form-group pt-2 pb-2">
                  <input
                    type="text"
                    name="lastName"
                    className="form-control"
                    placeholder="Last Name"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Last Name */}

                {/* START Email */}
                <div className="form-group pt-2 pb-2">
                  <input
                    type="email"
                    name="email"
                    className="form-control"
                    placeholder="Email"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Email */}

                {/* START Password */}
                <div className="form-group pt-2 pb-2">
                  <input
                    type="password"
                    name="password1"
                    className="form-control"
                    placeholder="Password"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Password */}

                {/* START Password Repeat */}
                <div className="form-group pt-2 pb-2">
                  <input
                    type="password"
                    name="password2"
                    className="form-control"
                    placeholder="Repeat Password"
                    required
                    onChange={this.handleChange}
                  />
                </div>
                {/* END Password repeat*/}

                <button
                  type="submit"
                  className="btn btn-outline-danger"
                  onClick={this.singinClicked}>
                  Create Account
                </button>

                <Link className="btn btn-link ml-5" to="/login">
                  <small className="text-primary">Login</small>
                </Link>
              </form>
            </div>
          </div>
        </div>
      </section>
    );
  }
}
